import React, {useState} from 'react'
import './App.css';

function App() {

  const [good, setGood] = useState(0)
  const [neutral, setNeutral] = useState(0)
  const [bad, setBad] = useState(0)

  return (
    <div className="App">
      <h2>Statistics</h2>
      <button onClick={()=>{setGood(good+1)}}>Good</button><br/>
      <button onClick={()=>{setNeutral(neutral+1)}}>Neutral</button><br/>
      <button onClick={()=>{setBad(bad+1)}}>Bad</button><br/>
      Good: {good}<br/>
      Neutral: {neutral}<br/>
      Bad: {bad}<br/>
    </div>
  );
}

export default App;
